import React from 'react';
import './App.css';
import LeftMenu from "./components/LeftMenu/LeftMenu";
import PlayPanel from "./components/PlayPanel/PlayPanel";
import Header from "./components/Header/Header";

function App() {
    return (

        <div>

            <LeftMenu/>


            <div className="ms_content_wrapper">

                <Header />




            </div>

            <PlayPanel/>

        </div>
    );
}

export default App;
